import React, { Component } from 'react';
import "../styles/style.css"

import FF_icon from "../images/FF_icon.png"


class Projects extends Component {
    render() {
        return (
            <div className="projects">
                <hr />
                <div className="projectsHeader">
                    <h1>My Projects</h1>
                </div>
                <div className="FF_content">
                <div className="FF_icon_and_header">
                    <a href="http://www.faceflex5000.com" target="_blank"  className="faceflex">FACEFLEX-5000</a>
                    <img className="FF_icon" src={FF_icon} alt="game_snapshot" />
                </div>
                <p>Faceflex is a web game that uses facial-recognition technology to let users match as many celebrity expressions as they can </p>
                </div>
            </div>
        );
    }
}

export default Projects;
